INSERT INTO `field_data_body` (`entity_type`, `bundle`, `deleted`, `entity_id`, `revision_id`, `language`, `delta`, `body_value`, `body_summary`, `body_format`) VALUES
('node', 'page', 0, 1, 1, 'und', 0, '<p class="rtejustify">Cee &amp; Gee Precision is a profile of a man and wife machine shop founded in September 1993. It used to be in a 500 square feet-manufacturing area with a couple of used manual machines. Today, it is now a thriving machining job shop with 12 employees (all highly qualified and experienced) running 10 CNC mill and lathe machines in a modern 6000 square feet facility in the heart of California’s silicon valley.</p>\r\n\r\n<p class="rtejustify">The company is highly equipped with the latest state of the art machines, coupled with advanced manufacturing technologies and automated systems to do CNC milling and turning job. Today, we have a mix of vertical and horizontal systems, a lot of support and inspection equipment. As a result we could offer engineering at the prototype level and some value-added customer specifications at the production stage. We have developed strong working relationships and stay connected with our customers. Satisfying the customer’s needs put us ahead of the game.</p>\r\n\r\n<p class="rtejustify">We offer CNC machining, precision turning, milling, part modification, quick turn-around and assembly. We machine all types of materials from the ordinary aluminum, stainless, copper/brass and plastics to the more exotic materials such as Kovar, Torlon, Vespel and Titanium.</p>\r\n', '', 'full_html'),
('node', 'page', 0, 2, 2, 'und', 0, '<p>&nbsp;</p>\r\n\r\n<ul>\r\n	<li>Engineering Assistance&nbsp;<img alt="" src="http://ceegeeprecision.com/sites/ceegeeprecision.com/files/engineering.png" style="width: 612px; height: 144px; margin-right: 10px; margin-left: 10px; float: right;" /></li>\r\n	<li>Finishing - [Cleaning &amp; Deburring]&nbsp;</li>\r\n	<li>Milling - CNC&nbsp;</li>\r\n	<li>Milling - Manual&nbsp;</li>\r\n	<li>Turning - CNC&nbsp;</li>\r\n	<li>Turning - Manual</li>\r\n</ul>\r\n', '', 'full_html'),
('node', 'page', 0, 3, 3, 'und', 0, '<p><img alt="" height="144" src="http://ceegeeprecision.com/sites/ceegeeprecision.com/files/materials.png" width="612" /></p>\r\n\r\n<table border="0" bordercolor="#111111" cellpadding="4" cellspacing="0" style="color: rgb(0, 0, 0); font-family: Verdana; line-height: normal; border-collapse: collapse;" width="395">\r\n	<tbody>\r\n		<tr>\r\n			<td class="tdline" nowrap="nowrap" style="border-bottom-color: rgb(204, 204, 204); border-bottom-style: solid; font-size: 10pt;" valign="top" width="131"><b>Aluminum alloys</b></td>\r\n			<td class="tdline" style="border-bottom-color: rgb(204, 204, 204); border-bottom-style: solid; font-size: 10pt;" valign="top" width="248">All Types (6061 -T6, 7075 etc.)</td>\r\n		</tr>\r\n		<tr>\r\n			<td class="tdline" nowrap="nowrap" style="border-bottom-color: rgb(204, 204, 204); border-bottom-style: solid; font-size: 10pt;" valign="top" width="131"><b>Composites</b></td>\r\n			<td class="tdline" style="border-bottom-color: rgb(204, 204, 204); border-bottom-style: solid; font-size: 10pt;" valign="top" width="248">Iron Epoxy, Kevlar, Noryl, etc.</td>\r\n		</tr>\r\n		<tr>\r\n			<td class="tdline" nowrap="nowrap" style="border-bottom-color: rgb(204, 204, 204); border-bottom-style: solid; font-size: 10pt;" valign="top" width="131"><b>Controlled&nbsp;<br />\r\n			expansion alloys</b></td>\r\n			<td class="tdline" style="border-bottom-color: rgb(204, 204, 204); border-bottom-style: solid; font-size: 10pt;" valign="top" width="248">Kovar, Invar, Haynes 242, Inconel<br />\r\n			etc.</td>\r\n		</tr>\r\n		<tr>\r\n			<td class="tdline" nowrap="nowrap" style="border-bottom-color: rgb(204, 204, 204); border-bottom-style: solid; font-size: 10pt;" valign="top" width="131"><b>Copper alloys</b></td>\r\n			<td class="tdline" style="border-bottom-color: rgb(204, 204, 204); border-bottom-style: solid; font-size: 10pt;" valign="top" width="248">All Copper Alloys (Beryllium Copper)</td>\r\n		</tr>\r\n		<tr>\r\n			<td class="tdline" nowrap="nowrap" style="border-bottom-color: rgb(204, 204, 204); border-bottom-style: solid; font-size: 10pt;" valign="top" width="131"><b>Specialty Alloys</b></td>\r\n			<td class="tdline" style="border-bottom-color: rgb(204, 204, 204); border-bottom-style: solid; font-size: 10pt;" valign="top" width="248">All Types (Electronic Iron, Consumet Core Iron, Vacuum Melt Core Iron)</td>\r\n		</tr>\r\n		<tr>\r\n			<td class="tdline" nowrap="nowrap" style="border-bottom-color: rgb(204, 204, 204); border-bottom-style: solid; font-size: 10pt;" valign="top" width="131"><b>Nickel alloys</b></td>\r\n			<td class="tdline" style="border-bottom-color: rgb(204, 204, 204); border-bottom-style: solid; font-size: 10pt;" valign="top" width="248">Nickel 200, Monel, Cu-Ni 715</td>\r\n		</tr>\r\n		<tr>\r\n			<td class="tdline" style="border-bottom-color: rgb(204, 204, 204); border-bottom-style: solid; font-size: 10pt;" valign="top" width="131"><b>Plastics &amp; Polymers</b></td>\r\n			<td class="tdline" style="border-bottom-color: rgb(204, 204, 204); border-bottom-style: solid; font-size: 10pt;" valign="top" width="248">Polycarbonate, Nylon, Teflon, Polyimide (Vespel), Polysulfone, Lexan, Ardel, Delrin, Acrylic, PVC, TPX DX845</td>\r\n		</tr>\r\n		<tr>\r\n			<td class="tdline" style="border-bottom-color: rgb(204, 204, 204); border-bottom-style: solid; font-size: 10pt;" valign="top" width="131"><b>Steels</b></td>\r\n			<td class="tdline" style="border-bottom-color: rgb(204, 204, 204); border-bottom-style: solid; font-size: 10pt;" valign="top" width="248">All</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n', '', 'full_html'),
('node', 'page', 0, 5, 5, 'und', 0, '<p>Contact No(s):<img alt="" src="http://ceegeeprecision.com/sites/ceegeeprecision.com/files/GRB8.png" style="width: 400px; height: 216px; float: right;" /><br />\r\n<span style="line-height: 1.6em;">Fax No.: +1 (408) 935 9328</span><br />\r\n<span style="line-height: 1.6em;">Office No.: +1 (408) 935 9327</span></p>\r\n\r\n<p>Email Address:</p>\r\n\r\n<table border="1" cellpadding="1" cellspacing="1" style="width: 500px;">\r\n	<tbody>\r\n		<tr>\r\n			<td>Cecil P. Lantin,&nbsp;President</td>\r\n			<td>clantin@ceegeeprecision.com</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Glen Fajardo-Lantin, Executive VP</td>\r\n			<td>glantin@ceegeeprecision.com</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Ida Fajardo, VP Marketing</td>\r\n			<td>idafajardo@ceegeeprecision.com</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p>Adress:<br />\r\n<span style="font-family: Arial; font-size: 12px; line-height: 19.4375px;">2290 Trade Zone Blvd, San Jose, Clifornia, USA 95131</span></p>\r\n', '', 'full_html');
