INSERT INTO `search_dataset` (`sid`, `type`, `data`, `reindex`) VALUES
(1, 'node', ' about us cee gee precision is a profile of a man and wife machine shop founded in september 1993 it used to be in a 500 square feetmanufacturing area with a couple of used manual machines today it is now a thriving machining job shop with 12 employees all highly qualified and experienced running 10 cnc mill and lathe machines in a modern 6000 square feet facility in the heart of california s silicon valley the company is highly equipped with the latest state of the art machines coupled with advanced manufacturing technologies and automated systems to do cnc milling and turning job today we have a mix of vertical and horizontal systems a lot of support and inspection equipment as a result we could offer engineering at the prototype level and some valueadded customer specifications at the production stage we have developed strong working relationships and stay connected with our customers satisfying the customer s needs put us ahead of the game we offer cnc machining precision turning milling part modification quick turnaround and assembly we machine all types of materials from the ordinary aluminum stainless copper brass and plastics to the more exotic materials such as kovar torlon vespel and titanium  ', 0),
(2, 'node', ' services  engineering assistance finishing cleaning deburring milling cnc milling manual turning cnc turning manual  ', 0),
(3, 'node', ' materials aluminum alloys all types 6061 t6 7075 etc  composites iron epoxy kevlar noryl etc controlled expansion alloys kovar invar haynes 242 inconel etc copper alloys all copper alloys beryllium copper  specialty alloys all types electronic iron consumet core iron vacuum melt core iron  nickel alloys nickel 200 monel cuni 715 plastics polymers polycarbonate nylon teflon polyimide vespel polysulfone lexan ardel delrin acrylic pvc tpx dx845 steels all  ', 0),
(4, 'node', ' production ', 0),
(5, 'node', ' contact us contact no s fax no 1 408 935 9328 office no 1 408 935 9327 email address cecil p lantin president clantin ceegeeprecisioncom glen fajardolantin executive vp glantin ceegeeprecisioncom ida fajardo vp marketing idafajardo ceegeeprecisioncom adress 2290 trade zone blvd san jose clifornia usa 95131  ', 0);
